import react from "react";
import styles from "./Header.module.css";

const Header = () => {
  return (
    <react.Fragment>
      <header className={styles.header}>
        ReactMeals
        <cart>cart</cart>
      </header>
      <div className={`${styles['main-image']}`}>
        <img src="meals.jpg" alt="meal"></img>
      </div>
    </react.Fragment>
  );
};

export default Header;
